import React from "react";
import { css } from "@emotion/core";
import { COLORS } from "../../constants";
const SideNavLinks = () => {
  return (
    <React.Fragment>
      <ul
        css={css`
          height: calc(100% - 190px);
          overflow-y: auto;
          overflow-x: hidden;
          padding: 10px 40px 10px 40px;
        `}
      >
        <li>Dashboard</li>
        <li>Imports</li>
        <li>Notifications</li>
        <li>Profile</li>
        <li>Dashboard</li>
        <li>Dashboard</li>
        <li>Dashboard</li>
        <li>Dashboard</li>
        <li>Dashboard</li>
        <li>Dashboard</li>
        <li>Dashboard</li>
        <li>Dashboard</li>
        <li>Dashboard</li>
        <li>Dashboard</li>
        <li>Dashboard</li>
        <li>Dashboard</li>
        <li>Dashboard</li>
        <li>Dashboard</li>
        <li>Dashboard</li>
        <li>Dashboard</li>
        <li>Dashboard</li>
        <li>Dashboard</li>
        <li>Dashboard</li>
        <li>Dashboard</li>
        <li>Dashboard</li>
      </ul>
    </React.Fragment>
  );
};

export default SideNavLinks;
